  input: TEXT,F3A,,"11/1/02- Douglas Bloom only gave one $1000 contribution. There
    was a filing error for this donor which inadvertently has him listed as giving
    two $1000 contributions.    Schedule A of the report contains the 48 hour notices.
    After a complete internal review of all 48 hour notices filed, it was found that
    checks were submitted with the date written on the check, and not the date that
    the Committee actually received the check. Therefore, it may look as if many of
    the checks that were submitted were filed late, when in essence they were not.
    Also, there were a number of errors encountered with submitting the amendment
    of this report. I made contact with our Reports Analyst, who then referred me
    to Electronic Filing Division. After I was able to touch base with someone able
    to offer me technical assistance, the report was corrected."
